import React from 'react';
import { StyleSheet, Text, View, StatusBar, SafeAreaView, TouchableNativeFeedback, Image , FlatList} from 'react-native';
import { useDimensions} from '@react-native-community/hooks';
import Navbar from "./Views/navbar"
import { render } from 'react-dom';


export default function App() {
    // Functions
    const searchPress = () => {
        alert("lol");
    }
    const getSubAnime = () => {
        return fetch('https://gogoanime.vc')
            .then((response) => response.text())
            .then(function(data){
                var n = data.split(`<ul class="items">`);
                var m = n[1].split(`</ul>`);
                console.log(JSON.stringify(m[0].replace("img", "ssss")))
            })
    }
    getSubAnime()
    return (
       
        <Navbar></Navbar>
      );
}
